    <div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y1 ff1 fs0 fc0 sc0 ls0 ws0">Site interference policy<span class="ff2">:- </span></div><div class="t m0 x1 h2 y2 ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:-<span class="fs0"> </span></div><div class="t m0 x1 h3 y3 ff4 fs2 fc0 sc0 ls0 ws0">We strive to make <span class="ff5">www.talegaon.co.in</span> a safe and trusted marketplace for both buy<span class="_ _0"></span>ers and </div><div class="t m0 x1 h3 y4 ff4 fs2 fc0 sc0 ls0 ws0">sellers. Interference or attempted interference with the <span class="ff5">www.talegaon.co.in</span> site, site </div><div class="t m0 x1 h3 y5 ff4 fs2 fc0 sc0 ls0 ws0">operations, or policies isn&apos;t allowed. This includes attempts to purposely<span class="_ _0"></span> cir<span class="_ _1"></span>cumvent our buying </div><div class="t m0 x1 h3 y6 ff4 fs2 fc0 sc0 ls0 ws0">and selling policies, or the way our site functions. These<span class="_ _0"></span> kinds of activities can undermine trust, </div><div class="t m0 x1 h3 y7 ff4 fs2 fc0 sc0 ls0 ws0">interfere with searching for items, and negatively affect both buyers and sellers.  </div><div class="t m0 x1 h3 y8 ff4 fs2 fc0 sc0 ls0 ws0">Examples of the type of behavior that isn&apos;t allowed are<span class="_ _0"></span> in these guidelines, but any attempt to </div><div class="t m0 x1 h3 y9 ff4 fs2 fc0 sc0 ls0 ws0">manipulate our site or policies may result in action against your account. In addition to your </div><div class="t m0 x1 h3 ya ff4 fs2 fc0 sc0 ls0 ws0">listing being removed, you may be subject to a range of other actions, including<span class="_ _0"></span> limits of <span class="_ _1"></span>your </div><div class="t m0 x1 h3 yb ff4 fs2 fc0 sc0 ls0 ws0">buying and selling privileges or suspension of your acc<span class="_ _0"></span>ount.<span class="_ _1"></span> </div><div class="t m0 x1 h4 yc ff1 fs3 fc0 sc0 ls0 ws0