    <div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y1 ff1 fs0 fc0 sc0 ls0 ws0">Profanity policy:- </div><div class="t m0 x1 h2 y2 ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:-<span class="fs0"> </span></div><div class="t m0 x1 h3 y3 ff5 fs2 fc0 sc0 ls0 ws0">For a pleasant experience on www.talegaon.co.in, we don&apos;t allow using hatefu<span class="ff4">l, offensive, </span></div><div class="t m0 x1 h3 y4 ff4 fs2 fc0 sc0 ls0 ws0">profane, or vulgar language in public areas of the website, including<span class="_ _0"></span>:<span class="_ _1"></span> </div><div class="t m0 x2 h3 y18 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Profiles </span></span></div><div class="t m0 x2 h3 y19 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Chat rooms </span></span></div><div class="t m0 x2 h3 y1a ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Discussion boards </span></span></div><div class="t m0 x2 h3 y8 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff5 fs2">www.talegaon.co.in Motors<span class="ff4"> </span></span></span></div><div class="t m0 x2 h3 y9 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff5 fs2">www.talegaon.co.in Stores<span class="ff4"> </span></span></span></div><div class="t m0 x2 h3 ya ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Feedback </span></span></div><div class="t m0 x2 h3 yb ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Listings </span></span></div><div class="t m0 x2 h3 y1b ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Collections (you can report a collection if you think it violates our profa<span class="_ _0"></span>nit<span class="_ _1"></span>y policy) </span></span></div><div class="t m0 x2 h3 y1c ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Other areas of the site that people see </span></span></div><div class="t m0 x1 h3 y1d ff4 fs2 fc0 sc0 ls0 ws0">To find out more about our profanity policy, see the g<span class="_ _0"></span>uidelines below.<span class="_ _1"></span> </div><div class="t m0 x1 h3 y1e ff4 fs2 fc0 sc0 ls0 ws0">Make sure your listing follows these guidelines. If it doesn&apos;t, it may<span class="_ _0"></span> be removed, and <span class="_ _1"></span>you may be </div><div class="t m0 x1 h3 y1f ff4 fs2 fc0 sc0 ls0 ws0">subject to a range of other actions, including<span class="_ _0"></span> restrictions of <span class="_ _1"></span>your buying and selling privileges </div><div class="t m0 x1 h3 y20 ff4 fs2 fc0 sc0 ls0 ws0">and suspension of your account. </div><div class="t m0 x2 h3 y21 ff4 fs2 fc0 sc0 ls0 ws0">1)<span class="ff7"> <span class="_ _3"> </span></span>Allowed :-  </div><div class="t m0 x2 h3 y22 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">An item listed in the Adult Only category that includes a profane word as part of its </span></span></div><div class="t m0 x3 h3 y23 ff4 fs2 fc0 sc0 ls0 ws0">official title or description </div><div class="t m0 x2 h3 y24 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Music CD, movie DVD, or other media items with titles that include profanity. The </span></span></div><div class="t m0 x3 h3 y25 ff4 fs2 fc0 sc0 ls0 ws0">profane word has to be part of an official title (f<span class="_ _0"></span>or example, a song title) that was </div><div class="t m0 x3 h3 y26 ff4 fs2 fc0 sc0 ls0 ws0">originally released by the company that made the item.  </div><div class="t m0 x2 h3 y27 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Officially released product with a brand name that includes a profane word. </span></span></div><div class="t m0 x1 h3 y28 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 y29 ff4 fs2 fc0 sc0 ls0 ws0">     2) Restricted: - </div><div class="t m0 x2 h3 y2a ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Novelty items (hats, T-shirts, and so on) with profanity have to meet the following </span></span></div><div class="t m0 x3 h3 y2b ff4 fs2 fc0 sc0 ls0 ws0">criteria:  </div><div class="t m0 x2 h3 y2c ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _4"> </span><span class="ff4 fs2">The majority of the profane word has to be replaced with asterisks (for example, s*** or </span></span></div><div class="t m0 x3 h3 y2d ff4 fs2 fc0 sc0 ls1 ws0">f*<span class="ls0">**). </span></div><div class="t m0 x2 h3 y2e ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _4"> </span><span class="ff4 fs2">Any image showing the profane word needs to be blurred out as well.  </span></span></div><div class="t m0 x1 h3 y2f ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 y30 ff4 fs2 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h3 y31 ff4 fs2 fc0 sc0 ls0 ws0">     3) Not allowed:- </div><div class="t m0 x2 h3 y32 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Hateful, obscene, offensive, racist, sexual, or violent words in any public are<span class="_ _0"></span>a of </span></span></div><div class="t m0 x3 h3 y33 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in.<span class="ff4"> </span></div><div class="t m0 x2 h3 y34 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Offensive user IDs. </span></span></div><div class="t m0 x2 h3 y35 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Profane language to describe an item for sale. </span></span></div><div class="t m0 x2 h3 y36 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Profanity in a listing title or description. </span></span></div><div class="t m0 x3 h3 y37 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 y38 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y39 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y3a ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y3b ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y3c ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y3d ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y3e ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y3f ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y40 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y41 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y42 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y43 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y44 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y45 ff1 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf4" class="pf w0 h0" data-page-no="4"><div class="pc pc4 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y1 ff1 fs0 fc0 sc0 ls0 ws0">Using multiple accounts policy:- </div><div class="t m0 x1 h5 y2 ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:- </div><div class="t m0 x1 h6 y3 ff5 fs2 fc0 sc0 ls0 ws0">There are many reasons why<span class="_ _0"></span> users would choose to have more than one www.talegaon.co.in </div><div class="t m0 x1 h3 y4 ff4 fs2 fc0 sc0 ls0 ws0">account. For example, users who like to buy and sell may want separate accounts for each </div><div class="t m0 x1 h3 y5 ff5 fs2 fc0 sc0 ls0 ws0">activity. Other users who maintain businesses on www.talega<span class="_ _0"></span>on.co.in may pref<span class="_ _1"></span><span class="ff4">er to manage </span></div><div class="t m0 x1 h3 y6 ff4 fs2 fc0 sc0 ls0 ws0">separate accounts for different product lines.   </div><div class="t m0 x1 h6 y1a ff5 fs2 fc0 sc0 ls0 ws0">Whether you have one account or more, www.ta<span class="_ _0"></span>legaon.co.in expects users to manage each of </div><div class="t m0 x1 h3 y8 ff4 fs2 fc0 sc0 ls0 ws0">their accounts effectively in order to meet the highest buyer and seller standards. The<span class="_ _0"></span>se standards </div><div class="t m0 x1 h3 y9 ff4 fs2 fc0 sc0 ls0 ws0">and rules regarding performance, risk, and best practices are<span class="_ _0"></span> applicable for each account and help </div><div class="t m0 x1 h3 ya ff5 fs2 fc0 sc0 ls0 ws0">ensure a safe and positive experience<span class="_ _0"></span> on www.ta<span class="_ _1"></span>legaon.co.in.<span class="ff4"> </span></div><div class="t m0 x1 h3 y46 ff4 fs2 fc0 sc0 ls0 ws0">Users are expected to resolve issues as they arise, and follow the steps provided by<span class="_ _0"></span> </div><div class="t m0 x1 h6 y47 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in to bring accounts back into g<span class="_ _0"></span>ood standing before continuing to bu<span class="_ _1"></span>y or sell </div><div class="t m0 x1 h3 y48 ff4 fs2 fc0 sc0 ls0 ws0">with other accounts. </div><div class="t m0 x1 h6 y49 ff5 fs2 fc0 sc0 ls0 ws0">Make sure you follow these guidelines. If y<span class="_ _0"></span>ou dont, <span class="_ _1"></span>you may be subject to a range<span class="_ _0"></span> of actions, </div><div class="t m0 x1 h3 y1e ff4 fs2 fc0 sc0 ls0 ws0">including limits of your buying a<span class="_ _0"></span>nd selling privileges a<span class="_ _1"></span>nd suspension of your account. </div><div class="t m0 x1 h7 y4a ff3 fs2 fc0 sc0 ls0 ws0">Not allowed:-<span class="ff4">  </span></div><div class="t m0 x1 h3 y4b ff4 fs2 fc0 sc0 ls0 ws0">Registering new accounts or using other existing accounts to avoid buying and selling </div><div class="t m0 x1 h8 y4c ff4 fs2 fc0 sc0 ls0 ws0">restrictions or limits or other policy consequences.<span class="ff3 fs3"> </span></div><div class="t m0 x1 h8 y4d ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y4e ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y4f ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y50 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y51 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y52 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y53 ff1 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf5" class="pf w0 h0" data-page-no="5"><div class="pc pc5 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y54 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 y55 ff8 fs0 fc0 sc0 ls0 ws0">Offers to Buy or Sell Outside of www.talegaon.co.in <span class="ff1">policy:- </span></div><div class="t m0 x1 h5 y56 ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:- </div><div class="t m0 x1 h6 y57 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in prohibits email offers to buy<span class="_ _0"></span> or sell listed it<span class="_ _1"></span>ems outside of the </div><div class="t m0 x1 h6 y58 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in Web site. Offers of this nature circumvent www.talegaon.co.in&apos;s fee </div><div class="t m0 x1 h3 y59 ff4 fs2 fc0 sc0 ls0 ws0">structure and are a potential fraud risk for both buy<span class="_ _0"></span>ers and s<span class="_ _1"></span>ellers. </div><div class="t m0 x1 h7 y5a ff3 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h7 y5b ff3 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h9 y5c ff3 fs5 fc0 sc0 ls0 ws0">Some examples <span class="_ _0"></span>of off-site offers include<span class="fs2">:<span class="_ _0"></span> </span></div><div class="t m0 x1 h6 y5d ff5 fs2 fc0 sc0 ls0 ws0">Using information obtained through www.talegaon.co.in to offer to buy<span class="_ _0"></span> or sell a listed item </div><div class="t m0 x1 h3 y5e ff5 fs2 fc0 sc0 ls0 ws0">outside of www.talegaon.co.in.<span class="ff4"> </span></div><div class="t m0 x2 h3 y5f ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Cancelling a listing to sell to a buyer who became awa<span class="_ _0"></span>re of the item through </span></span></div><div class="t m0 x3 h3 y60 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in.<span class="ff4"> </span></div><div class="t m0 x2 h3 y61 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Offering to sell duplicate or additional merchandise. </span></span></div><div class="t m0 x1 h9 y62 ff3 fs5 fc0 sc0 ls0 ws0">Policies Rules f<span class="_ _0"></span>or everyone<span class="fs2">:- </span></div><div class="t m0 x1 h3 y63 ff4 fs2 fc0 sc0 ls0 ws0">Unsolicited Commercial email (SPAM) |<span class="_ _0"></span> Offers to Bu<span class="_ _1"></span>y or Sell Outside of <span class="ff5">www.talegaon.co.in</span> </div><div class="t m0 x1 h3 y64 ff4 fs2 fc0 sc0 ls0 ws0">Even though offers to buy<span class="_ _0"></span> or sell outsi<span class="_ _1"></span>de of <span class="ff5">www.talegaon.co.in</span> are not always made with the </div><div class="t m0 x1 h3 y65 ff4 fs2 fc0 sc0 ls0 ws0">intent to defraud, there is always a significant level of risk involved. Please be aware that items </div><div class="t m0 x1 h3 y66 ff4 fs2 fc0 sc0 ls0 ws0">purchased as a result of an outside of <span class="ff5">www.talegaon.co.in</span> offer are not eligible for </div><div class="t m0 x1 h3 y67 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in<span class="ff4"> services, including: </span></div><div class="t m0 x2 h3 y68 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Feedback </span></span></div><div class="t m0 x2 h3 y69 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Requests for contact information </span></span></div><div class="t m0 x2 h3 y6a ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Coverage under the <span class="ff5">www.talegaon.co.in</span> services &amp; policies. </span></span></div><div class="t m0 x1 h3 y6b ff4 fs2 fc0 sc0 ls0 ws0">Some members have reported receiving outside of <span class="ff5">www.talegaon.co.in</span> offers from sellers who </div><div class="t m0 x1 h3 y6c ff4 fs2 fc0 sc0 ls0 ws0">insist that payment be sent using third-party instant cash transfer services. These services are<span class="_ _0"></span> </div><div class="t m0 x1 h3 y6d ff4 fs2 fc0 sc0 ls0 ws0">designed to allow individuals to send money to trusted parties such a<span class="_ _0"></span>s family and friends. </div><div class="t m0 x1 h3 y6e ff4 fs2 fc0 sc0 ls0 ws0">Requests to send instant cash to an unknown third-party present a significant fraud risk, </div><div class="t m0 x1 h3 y6f ff4 fs2 fc0 sc0 ls0 ws0">especially when the seller is offering to sell outside of the <span class="ff5">www.talegaon.co.in</span> Web site. If you </div><div class="t m0 x1 h3 y70 ff4 fs2 fc0 sc0 ls0 ws0">have received an offer of this nature, please<span class="_ _0"></span> report it to us<span class="_ _1"></span> immediately<span class="_ _0"></span>.<span class="_ _1"></span> </div><div class="t m0 x1 h3 y71 ff4 fs2 fc0 sc0 ls0 ws0">Buyers who request that items be sold outside of <span class="ff5">www.talegaon.co.in</span> who wish to pay for the </div><div class="t m0 x1 h3 y72 ff4 fs2 fc0 sc0 ls0 ws0">items with a credit card are also cause for<span class="_ _0"></span> concern, especiall<span class="_ _1"></span>y when the buyer requests that items </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf6" class="pf w0 h0" data-page-no="6"><div class="pc pc6 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h3 y31 ff4 fs2 fc0 sc0 ls0 ws0">be shipped internationally<span class="_ _0"></span>. Thes<span class="_ _1"></span>e types of offers may indicate that the buyer is attempting<span class="_ _0"></span> to </div><div class="t m0 x1 h3 y73 ff4 fs2 fc0 sc0 ls0 ws0">purchase an item using stolen funds. If you suspect that this is the case, y<span class="_ _0"></span>ou can report the </div><div class="t m0 x1 h3 y74 ff4 fs2 fc0 sc0 ls0 ws0">member making the offer from the Rece<span class="_ _0"></span>iving Pa<span class="_ _1"></span>yments page. </div><div class="t m0 x1 h9 y75 ff3 fs5 fc0 sc0 ls0 ws0">Reporting out<span class="_ _0"></span>side of <span class="ff9">www.talegaon.c<span class="_ _0"></span>o.in<span class="ff3"> offers:-<span class="ff4"> </span></span></span></div><div class="t m0 x1 h3 y76 ff4 fs2 fc0 sc0 ls0 ws0">If you would like to report a user who is atte<span class="_ _0"></span>mptin<span class="_ _1"></span>g to sell an item off-site through text in the </div><div class="t m0 x1 h3 y77 ff4 fs2 fc0 sc0 ls0 ws0">item description, please refer to the<span class="_ _0"></span> Sales Outside <span class="_ _1"></span>of <span class="ff5">www.talegaon.co.in</span> page. </div><div class="t m0 x1 h3 y78 ff4 fs2 fc0 sc0 ls0 ws0">To report any other off-site offers, contact <span class="ff5">www.talegaon.co.in</span> with the item number that the </div><div class="t m0 x1 h3 y79 ff4 fs2 fc0 sc0 ls0 ws0">offer refers to, the User ID or email address or name of the member you are reporting, and a </div><div class="t m0 x1 h3 y7a ff4 fs2 fc0 sc0 ls0 ws0">copy of the email. </div><div class="t m0 x1 h3 y7b ff4 fs2 fc0 sc0 ls0 ws0">Policies Rules for everyone Unsolicited Commercial email (SPAM):  </div><div class="t m0 x1 h6 y7c ff5 fs2 fc0 sc0 ls0 ws0">Contact www.talegaon.co.in to report an outside of www.talegaon.co.in email offer from a </div><div class="t m0 x1 h3 y7d ff4 fs2 fc0 sc0 ls0 ws0">Seller.  </div><div class="t m0 x1 h9 y7e ff3 fs5 fc0 sc0 ls0 ws0">Transactions outs<span class="_ _0"></span>ide of www.taleg<span class="_ _0"></span>aon.co.in<span class="ffa">:- </span></div><div class="t m0 x1 ha y7f ff2 fs6 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h6 y80 ff5 fs2 fc0 sc0 ls0 ws0">Transactions outside of www.talegaon.co.in are not eligible for www.talegaon.c<span class="_ _0"></span>o.in </div><div class="t m0 x1 h3 y81 ff4 fs2 fc0 sc0 ls0 ws0">services, including feedback. If you knowing<span class="_ _0"></span>l<span class="_ _1"></span>y or unknowingly transacted outside of </div><div class="t m0 x1 h3 y82 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in and believe you were defrauded its on your own responsibility<span class="_ _0"></span>.<span class="_ _1"></span><span class="ff4"> </span></div><div class="t m0 x1 h3 y83 ff4 fs2 fc0 sc0 ls0 ws0">Violations of this policy may<span class="_ _0"></span> result in a range of actions, including: </div><div class="t m0 x2 h3 y84 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Listing or Want It Now post cancellation </span></span></div><div class="t m0 x2 h3 y85 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff5 fs2">Forfeit of www.talegaon.co.in fees on ca<span class="_ _0"></span>ncelled listi<span class="_ _1"></span>ngs<span class="ff4"> </span></span></span></div><div class="t m0 x2 h3 y86 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Limits placed on account privilege<span class="_ _0"></span>s<span class="_ _1"></span> </span></span></div><div class="t m0 x2 h3 y87 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Loss of Power-Seller status </span></span></div><div class="t m0 x2 h3 y88 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Account suspension. </span></span></div><div class="t m0 x1 h3 y89 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 y8a ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 y8b ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y8c ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y8d ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y8e ff3 fs3 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf7" class="pf w0 h0" data-page-no="7"><div class="pc pc7 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y54 ff1 fs0 fc0 sc0 ls0 ws0">Spam (Unsolicited Commercial Email) Policy:- </div><div class="t m0 x1 h5 y8f ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:- </div><div class="t m0 x1 h3 y90 ff5 fs2 fc0 sc0 ls0 ws0">Spam is not permitted on www.talegaon.co.in.<span class="ff4"> </span></div><div class="t m0 x1 h3 y91 ff4 fs2 fc0 sc0 ls0 ws0">Spam is email that is both unsolicited and commercial in nature. </div><div class="t m0 x2 h3 y92 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Unsolicited: The email has been sent without the permission of the person who received </span></span></div><div class="t m0 x3 h3 y93 ff4 fs2 fc0 sc0 ls2 ws0">it<span class="ls0"> </span></div><div class="t m0 x2 h3 y94 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Commercial: The email discusses buying, selling or trading of goods or services </span></span></div><div class="t m0 x1 h3 y95 ff4 fs2 fc0 sc0 ls0 ws0">Violations of this policy may<span class="_ _0"></span> result in a range of actions, including: </div><div class="t m0 x2 h3 y96 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Listing cancellation </span></span></div><div class="t m0 x2 h3 y97 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Limits on account privileg<span class="ls3">es</span> </span></span></div><div class="t m0 x2 h3 y98 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Account suspension  </span></span></div><div class="t m0 x2 h3 y99 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff5 fs2">Forfeit of www.talegaon.co.in fees on ca<span class="_ _0"></span>ncelled listi<span class="_ _1"></span>ngs <span class="ff4"> </span></span></span></div><div class="t m0 x2 h3 y9a ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Loss of Power-Seller status </span></span></div><div class="t m0 x1 h6 y9b ff5 fs2 fc0 sc0 ls0 ws0">If you have received spam from another www.talegaon.c<span class="_ _0"></span>o.in member (see examples below), In </div><div class="t m0 x1 h3 y9c ff4 fs2 fc0 sc0 ls0 ws0">order to investigate a spam report, we must have a complete copy of the email you received. </div><div class="t m0 x1 h3 y9d ff4 fs2 fc0 sc0 ls0 ws0">If you received a warning for violating<span class="_ _0"></span> our Spam polic<span class="_ _1"></span>y a<span class="_ _0"></span>nd <span class="_ _1"></span>you believe it was sent in error, or </div><div class="t m0 x1 h3 y9e ff4 fs2 fc0 sc0 ls0 ws0">you were suspended for violating our Spam policy<span class="_ _0"></span> and <span class="_ _1"></span>would like to contact us, please send us </div><div class="t m0 x1 h3 y9f ff4 fs2 fc0 sc0 ls0 ws0">an email. </div><div class="t m0 x1 h7 ya0 ff3 fs2 fc0 sc0 ls0 ws0">Some examples:- </div><div class="t m0 x1 h3 ya1 ff4 fs2 fc0 sc0 ls0 ws0">Some examples of spam include: </div><div class="t m0 x2 h3 ya2 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff5 fs2">Email sent to a member from a mailing list without the member<span class="_ _0"></span>s explicit permission<span class="_ _1"></span><span class="ff4"> </span></span></span></div><div class="t m0 x2 h3 ya3 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Direct or stand-alone invitations to join a mailing list </span></span></div><div class="t m0 x2 hb ya4 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff5 fs2">Email sent using the &quot;Contact www<span class="_ _0"></span>.tale<span class="_ _1"></span>gaon.co.in Member&quot; link on the </span></span></div><div class="t m0 x3 h3 ya5 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in Web site to send unsolicited commercial offers <span class="ff4"> </span></div><div class="t m0 x1 h2 ya6 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 y6d ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 ya7 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 ya8 ff3 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf8" class="pf w0 h0" data-page-no="8"><div class="pc pc8 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h2 ya9 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yaa ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h9 yab ff3 fs5 fc0 sc0 ls0 ws0">Additional Inf<span class="_ _0"></span>ormation:- </div><div class="t m0 x1 h3 yac ff4 fs2 fc0 sc0 ls0 ws0">Email <span class="ff5">offers to buy or sell items outside of the www.taleg<span class="_ _0"></span>aon.co.in site<span class="ff4"> a<span class="_ _1"></span>re not permitted. </span></span></div><div class="t m0 x1 h3 yad ff4 fs2 fc0 sc0 ls0 ws0">Offers of this nature circumvent www.talegaon.co.in&apos;s fee structure and are a potential fraud risk </div><div class="t m0 x1 h3 y78 ff4 fs2 fc0 sc0 ls0 ws0">for both buyers and sellers. </div><div class="t m0 x1 h7 yae ff3 fs2 fc0 sc0 ls0 ws0">Email and Websites impersonating <span class="ff9">www.talegaon.co.in<span class="ff4">  </span></span></div><div class="t m0 x1 h3 yaf ff4 fs2 fc0 sc0 ls0 ws0">Some members have reported receiving requests for personal information in email messages that </div><div class="t m0 x1 h6 y7b ff5 fs2 fc0 sc0 ls0 ws0">are made to appear that they were sent from www.talegaon.c<span class="_ _0"></span>o.in. More information on these </div><div class="t m0 x1 h3 y7c ff4 fs2 fc0 sc0 ls0 ws0">messages, as well as how they can be reported, can be found on the Email and Websites </div><div class="t m0 x1 h3 y7d ff5 fs2 fc0 sc0 ls0 ws0">Impersonating www.talegaon.co.in<span class="ff4"> <span class="ls4">pa</span>g<span class="_ _0"></span>e. </span></div><div class="t m0 x1 h7 yb0 ff3 fs2 fc0 sc0 ls0 ws0">Minimizing Unwanted Email<span class="ff4">  </span></div><div class="t m0 x1 h3 yb1 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in is concerned about your privacy. As outlined in our<span class="_ _0"></span> <span class="_ _1"></span><span class="ff4">Privacy Policy, we do </span></div><div class="t m0 x1 h3 yb2 ff4 fs2 fc0 sc0 ls0 ws0">not sell or disclose your information for mar<span class="_ _0"></span>keting purposes. Email addresses are only disclosed </div><div class="t m0 x1 h3 yb3 ff4 fs2 fc0 sc0 ls0 ws0">to members involved in <span class="ff5">www.talegaon.co.in transaction. www.talegaon.co.in will </span></div><div class="t m0 x1 h3 yb4 ff4 fs2 fc0 sc0 ls0 ws0">investigate and take action on reports of misuse of Contact <span class="ff5">www.talegaon.co.in Member</span>. </div><div class="t m0 x1 h6 yb5 ff5 fs2 fc0 sc0 ls0 ws0">In addition to the efforts taken by www.talega<span class="_ _0"></span>on.co.in to protect <span class="_ _1"></span>your privacy<span class="_ _0"></span>, there are several </div><div class="t m0 x1 h3 yb6 ff4 fs2 fc0 sc0 ls0 ws0">steps you can take to minimize the unwanted email you receive. </div><div class="t m0 x1 hc yb7 ff3 fs7 fc0 sc0 ls0 ws0">What is Not Cove<span class="_ _1"></span>red<span class="ff4">:- </span></div><div class="t m0 x1 h3 yb8 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h3 yb9 ff4 fs2 fc0 sc0 ls0 ws0">Please be aware that www.talegaon.co.in&apos;s spam policy applies only to unsolicited commercial </div><div class="t m0 x1 h6 yba ff5 fs2 fc0 sc0 ls0 ws0">messages sent by www.talegaon.co.in members. If you are receiving survey<span class="_ _0"></span>s, promotional </div><div class="t m0 x1 h3 ybb ff4 fs2 fc0 sc0 ls0 ws0">messa<span class="ff5">ges or other email from www.talegaon.co.in that y<span class="_ _0"></span>ou feel <span class="_ _1"></span>you should not be receiving, </span></div><div class="t m0 x1 h3 ybc ff4 fs2 fc0 sc0 ls0 ws0">please contact www.talegaon.co.in. </div><div class="t m0 x1 h3 ybd ff4 fs2 fc0 sc0 ls0 ws0">Email messages that are not commercial in nature, including offensive or unwelcome email, do </div><div class="t m0 x1 h3 ybe ff5 fs2 fc0 sc0 ls0 ws0">not fall under the www.talegaon.co.in <span class="ff4">spam policy. </span></div><div class="t m0 x1 h6 ybf ff5 fs2 fc0 sc0 ls0 ws0">Instant messages and other forms of communication conduc<span class="_ _0"></span>ted outside of www.talegaon.co.in </div><div class="t m0 x1 h3 yc0 ff4 fs2 fc0 sc0 ls0 ws0">are not within our jurisdiction. </div><div class="t m0 x1 h7 yc1 ff3 fs2 fc0 sc0 ls0 ws0">Mailing Lists<span class="ff4">  </span></div><div class="t m0 x1 h3 yc2 ff4 fs2 fc0 sc0 ls0 ws0">Sellers are permitted to invite other users to join a mailing list as long a<span class="_ _0"></span>s the email is related to </div><div class="t m0 x1 h3 yc3 ff4 fs2 fc0 sc0 ls0 ws0">the transaction and the mailing list invitation is not the primary<span class="_ _0"></span> purpose of the email.<span class="_ _1"></span> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf9" class="pf w0 h0" data-page-no="9"><div class="pc pc9 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h7 yc4 ff3 fs2 fc0 sc0 ls0 ws0">Reporting Spam<span class="ff4">  </span></div><div class="t m0 x1 h3 y73 ff5 fs2 fc0 sc0 ls0 ws0">If you have received spam from another www.talegaon.c<span class="_ _0"></span>o.in member, please <span class="ff4">r<span class="_ _1"></span>eport it. In order </span></div><div class="t m0 x1 h3 y74 ff4 fs2 fc0 sc0 ls0 ws0">to investigate a spam report, we must have a<span class="_ _0"></span> com<span class="_ _1"></span>plete cop<span class="_ _1"></span>y of the<span class="_ _0"></span> email. </div><div class="t m0 x1 h3 y34 ff4 fs2 fc0 sc0 ls0 ws0">If you received a warning for violating<span class="_ _0"></span> our spam <span class="_ _1"></span>policy and you believe that it was sent in error<span class="_ _0"></span>, </div><div class="t m0 x1 h3 y35 ff4 fs2 fc0 sc0 ls0 ws0">please contact us. </div><div class="t m0 x1 h3 yc5 ff4 fs2 fc0 sc0 ls0 ws0">If you were suspended for violating our Spam policy and would like to contact us, please send us </div><div class="t m0 x1 h3 y37 ff4 fs2 fc0 sc0 ls0 ws0">an email. </div><div class="t m0 x1 h9 yc6 ff3 fs5 fc0 sc0 ls0 ws0">Why does <span class="ff9">www.t<span class="_ _0"></span>alegaon.co.in h<span class="_ _0"></span>ave this policy?<span class="ff3"> </span></span></div><div class="t m0 x1 h6 yaf ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in understands that member<span class="_ _0"></span>s a<span class="_ _1"></span>re concerned about personal privacy. For this </div><div class="t m0 x1 h3 y7b ff5 fs2 fc0 sc0 ls0 ws0">reason, www.talegaon.co.in policy does not permit members to send spam.<span class="ff4"> </span></div><div class="t m0 x1 h8 y97 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 yc7 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 yc8 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 yc9 ff3 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 yca ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 ycb ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 ycc ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 ycd ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 yce ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 ycf ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 yd0 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h1 yd1 ff1 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pfa" class="pf w0 h0" data-page-no="a"><div class="pc pca w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y54 ff1 fs0 fc0 sc0 ls0 ws0">Cookies, Web Beacons, and Your Privacy:- </div><div class="t m0 x1 h5 y8f ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:- </div><div class="t m0 x1 h3 y90 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in uses <span class="ff4">cookies, web beacons, and related tools provided by third parties to </span></div><div class="t m0 x1 h6 yd2 ff5 fs2 fc0 sc0 ls0 ws0">provide you with services that make the <span class="_ _0"></span>www.talegaon.co.in site more efficient for <span class="_ _1"></span>your </div><div class="t m0 x1 h6 yd3 ff5 fs2 fc0 sc0 ls0 ws0">buying and selling activities. www.talegaon.c<span class="_ _0"></span>o.in limi<span class="_ _1"></span>ts the use of these tools to protect y<span class="_ _0"></span>our </div><div class="t m0 x1 h3 yd4 ff5 fs2 fc0 sc0 ls0 ws0">privacy. For more information on www.talega<span class="_ _0"></span>on.co.ins privac<span class="_ _1"></span>y pr<span class="ff4">actices, see </span></div><div class="t m0 x1 h3 yd5 ff5 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.ins <span class="ff4">Privacy Policy. We uses ssl secure server and tools for preventing you </span></div><div class="t m0 x1 h3 yd6 ff4 fs2 fc0 sc0 ls0 ws0">from cookies or other related spam. </div><div class="t m0 x1 h7 yd7 ff3 fs2 fc0 sc0 ls0 ws0">About cookies<span class="ff4"> </span></div><div class="t m0 x1 h6 yd8 ff5 fs2 fc0 sc0 ls0 ws0">&quot;Cookies&quot; are small files placed on the hard dr<span class="_ _0"></span>ive of your computer. www.talegaon.co.in uses </div><div class="t m0 x1 h3 yd9 ff4 fs2 fc0 sc0 ls0 ws0">cookies to provide services to you and help ensure account security. Most cookies are &quot;session </div><div class="t m0 x1 h3 yda ff4 fs2 fc0 sc0 ls0 ws0">cookies,&quot; meaning that they<span class="_ _0"></span> are automaticall<span class="_ _1"></span>y deleted from your hard drive once you finish/end </div><div class="t m0 x1 h3 ydb ff4 fs2 fc0 sc0 ls0 ws0">your session (log out or close your browser).  </div><div class="t m0 x1 h7 ydc ff9 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in uses<span class="ff3"> cookies on certain pages of the website to: <span class="ff4"> </span></span></div><div class="t m0 x2 h3 ydd ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Allow you to enter your password less frequently during a session.   </span></span></div><div class="t m0 x2 h3 yde ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Provide information that is targeted to your interests.   </span></span></div><div class="t m0 x2 h3 ydf ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Promote and enforce trust and safety.   </span></span></div><div class="t m0 x2 h3 ye0 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Offer certain features that are only ava<span class="_ _0"></span>ilabl<span class="_ _1"></span>e through the use of cookies.   </span></span></div><div class="t m0 x2 h3 ye1 ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Measure promotional effectiveness.   </span></span></div><div class="t m0 x2 h3 y3e ff6 fs4 fc0 sc0 ls0 ws0"><span class="ff7"> <span class="_ _2"> </span><span class="ff4 fs2">Analyze our web page flow.  </span></span></div><div class="t m0 x1 h2 ye2 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h7 ye3 ff3 fs2 fc0 sc0 ls0 ws0">Your choices about cookies<span class="ff4"> <span class="ff5"></span> We offer certain features that are only available through the use </span></div><div class="t m0 x1 h3 ye4 ff4 fs2 fc0 sc0 ls0 ws0">of a cookie. You are always free to decline cookies if your browse<span class="_ _0"></span>r permits. However, if <span class="_ _1"></span>you </div><div class="t m0 x1 h3 ye5 ff4 fs2 fc0 sc0 ls0 ws0">decline cookies, you may not be able to use certa<span class="_ _0"></span>in features on the website, and you ma<span class="_ _1"></span>y be<span class="_ _0"></span> </div><div class="t m0 x1 h3 ye6 ff4 fs2 fc0 sc0 ls1 ws0">re<span class="ls0">quired to reenter your password more frequently during a session. </span></div><div class="t m0 x1 h3 ye7 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h7 ye8 ff3 fs2 fc0 sc0 ls0 ws0">Web beacons:-<span class="ff4"> </span></div><div class="t m0 x1 h3 ye9 ff4 fs2 fc0 sc0 ls0 ws0">A web beacon is an electronic image placed in the web page<span class="_ _0"></span> code that can serve man<span class="_ _1"></span>y of the </div><div class="t m0 x1 h3 yea ff4 fs2 fc0 sc0 ls0 ws0">same purposes as cookies. Web beacons are used to track the traffic pa<span class="_ _0"></span>tterns of user<span class="_ _1"></span>s from one </div><div class="t m0 x1 h3 yeb ff4 fs2 fc0 sc0 ls0 ws0">page to another in order to maximize web traffic flow. </div><div class="t m0 x1 h3 yec ff4 fs2 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pfb" class="pf w0 h0" data-page-no="b"><div class="pc pcb w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h1 y54 ff1 fs0 fc0 sc0 ls0 ws0">Excessive Shipping and Handling policy:- </div><div class="t m0 x1 h5 y8f ff3 fs1 fc0 sc0 ls0 ws0">Policy over<span class="_ _0"></span>view:- </div><div class="t m0 x1 h3 y90 ff4 fs2 fc0 sc0 ls0 ws0">Sellers may charge reasonable shipping a<span class="_ _0"></span>nd handl<span class="_ _1"></span>ing fees to cover the costs for mailing, </div><div class="t m0 x1 h3 yd2 ff4 fs2 fc0 sc0 ls0 ws0">packaging, and handling the items/product which they<span class="_ _0"></span> are selling. Shipping and handling fees </div><div class="t m0 x1 h6 yd3 ff5 fs2 fc0 sc0 ls0 ws0">may not be listed as a percentage<span class="_ _0"></span> of the final sale price. www.talegaon.co.in has now set a </div><div class="t m0 x1 h3 yd4 ff4 fs2 fc0 sc0 ls0 ws0">maximum limit to the amount of Shipping and Handling charge<span class="_ _0"></span>s that a seller can charge the </div><div class="t m0 x1 h3 yd5 ff4 fs2 fc0 sc0 ls0 ws0">buyer for items. The seller is advised to refer to the list of maximum shipping<span class="_ _0"></span> charges he is </div><div class="t m0 x1 h3 yd6 ff4 fs2 fc0 sc0 ls0 ws0">allowed to charge. These charges are determined based on wha<span class="_ _0"></span>t sellers are charging (according </div><div class="t m0 x1 h3 yed ff4 fs2 fc0 sc0 ls0 ws0">to recent transaction data), product category<span class="_ _0"></span> and what buyers say the<span class="_ _1"></span>y c<span class="_ _0"></span>onsider reasonab<span class="_ _1"></span>le.  </div><div class="t m0 x1 h3 yee ff4 fs2 fc0 sc0 ls0 ws0">Sellers who want to be sure they are in compliance with this policy<span class="_ _0"></span> ma<span class="_ _1"></span>y c<span class="_ _0"></span>harge actual shipping </div><div class="t m0 x1 h3 yef ff4 fs2 fc0 sc0 ls0 ws0">costs plus actual packaging materials cost (or<span class="_ _0"></span> less). For reference, sellers can also view the </div><div class="t m0 x1 h3 yf0 ff4 fs2 fc0 sc0 ls0 ws0">maximum shipping charges that can be<span class="_ _0"></span> char<span class="_ _1"></span>ged for a particular category. </div><div class="t m0 x1 h6 ydb ff5 fs2 fc0 sc0 ls0 ws0">Seller must inform/contact to www.ta<span class="_ _0"></span>legaon.co.in/W<span class="_ _1"></span>ebsite owner before apply<span class="_ _0"></span>ing excessive </div><div class="t m0 x1 h3 yf1 ff4 fs2 fc0 sc0 ls0 ws0">shipping charges or any handling fees and also seller should agree<span class="_ _0"></span> with this Ex<span class="_ _1"></span>cessive Shipping </div><div class="t m0 x1 h3 yf2 ff4 fs2 fc0 sc0 ls0 ws0">and Handling policy before applying a<span class="_ _0"></span>n<span class="_ _1"></span>y charges. </div><div class="t m0 x1 h3 yf3 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yf4 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yf5 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yf6 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yf7 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yf8 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yf9 ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yfa ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 y6e ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yfb ff3 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h2 yfc ff3 fs0 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
